INSERT OR IGNORE INTO drug_interactions (id, ingredient1, ingredient2, severity, effect, source, management_text, mechanism_text, recommendation, risk_level, type, metabolism_info, source_url, reference_text, alternatives_a, alternatives_b, updated_at) VALUES (83107, 'Denosumab', 'Romosozumab', 'Moderate', 'Coadministration of romosozumab with bisphosphonates, denosumab, angiogenesis inhibitors, or corticosteroids may increase the risk of developing osteonecrosis of the jaw (ONJ). The condition can occur spontaneously and is generally associated with tooth extraction and/or local infection with delayed healing. Other risk factors for ONJ include cancer, chemotherapy, radiotherapy to the head and neck, poor oral hygiene, preexisting dental disease or infection, anemia, and coagulopathy.', 'DDInter', 'Caution is advised when romosozumab is used with other agents that are also associated with osteonecrosis of the jaw. A routine oral examination should be performed by the prescriber prior to initiation of romosozumab treatment. For patients requiring invasive dental procedures, clinical judgment and risk-benefit assessment should guide the management plan of each patient based on their clinical circumstances. Patients should be advised to seek medical attention if they experience signs and symptoms of ONJ, such as: pain in the mouth, teeth, or jaw; swelling or sores inside the mouth; numbness or a feeling of heaviness in the jaw; loosening of a tooth; or exposure of bone in the jaw.', 'Synergism', 'Caution is advised when romosozumab is used with other agents that are also associated with osteonecrosis of the jaw.', 'Moderate', 'pharmacodynamic', NULL, 'https://ddinter2.scbdd.com/server/interact/83208/', '', 'Romosozumab, Cholecalciferol, Vosoritide, Burosumab', 'Cholecalciferol, Vosoritide, Denosumab, Burosumab', 1767369485);
