INSERT OR IGNORE INTO drug_interactions (id, ingredient1, ingredient2, severity, effect, source, management_text, mechanism_text, recommendation, risk_level, type, metabolism_info, source_url, reference_text, alternatives_a, alternatives_b, updated_at) VALUES (83150, 'Denosumab', 'Aflibercept', 'Moderate', 'Concomitant use of immunosuppressive or myelosuppressive agents with denosumab may increase the risk of serious infections. Denosumab binds to and inhibits the receptor activator of nuclear factor kappa-B ligand (RANKL), which is expressed on activated T and B lymphocytes and in lymph nodes. Thus, denosumab alone may increase the risk of infections.', 'DDInter', 'Caution is advised if denosumab must be used in combination with immuno- or myelosuppressive agents. Patients should be advised to contact their physician if they develop signs and symptoms of infection such as fever, chills, diarrhea, sore throat, muscle aches, shortness of breath, blood in phlegm, weight loss, red or inflamed skin, body sores, and pain or burning during urination. The need for continued denosumab therapy should be assessed when serious infections occur during treatment.', 'Synergism', 'Caution is advised if denosumab must be used in combination with immuno- or myelosuppressive agents.', 'Moderate', 'pharmacodynamic', NULL, 'https://ddinter2.scbdd.com/server/interact/83251/', '', 'Tiludronic acid, Alendronic acid, Vosoritide, Etidronic acid, Ibandronate, Cholecalciferol, Burosumab, Risedronic acid, Zoledronic acid, Pamidronic acid', 'Bevacizumab, Verteporfin, Pertuzumab, Aminolevulinic acid, Tazemetostat, Tagraxofusp, Pegaspargase, Sotorasib, Enasidenib, Belzutifan, Mitotane, More', 1767369485);
INSERT OR IGNORE INTO drug_interactions (id, ingredient1, ingredient2, severity, effect, source, management_text, mechanism_text, recommendation, risk_level, type, metabolism_info, source_url, reference_text, alternatives_a, alternatives_b, updated_at) VALUES (83151, 'Denosumab', 'Zoledronic acid', 'Moderate', 'Osteonecrosis of the jaw (ONJ) has been reported with the use of angiogenesis inhibitors including denosumab, bevacizumab, and sunitinib. Concomitant exposure with other risk factors such as bisphosphonates (potency, route of administration, and cumulative dose), cancer, chemotherapy, corticosteroids, radiotherapy to the head and neck, dental disease, invasive dental procedures, or poor oral hygiene may increase the risk. Most reported cases with bevacizumab have occurred in patients who received prior or concomitant treatment with intravenous bisphosphonates or had a history of dental disease requiring invasive dental procedures.', 'DDInter', 'Caution is advised if bisphosphonates are used simultaneously or sequentially with denosumab or bevacizumab. Prior to initiating treatment, a thorough dental examination and appropriate preventive dentistry should be considered. If possible, invasive dental procedures should be avoided in patients who have previously received or are receiving intravenous bisphosphonates. Good oral hygiene practices should be maintained during treatment. Patients should be advised to seek medical attention if they experience signs and symptoms of osteonecrosis in the jaw, such as: pain in the mouth, teeth, or jaw, swelling or sores inside the mouth, numbness or a feeling of heaviness in the jaw, loosening of a tooth, or exposure of bone in the jaw. Temporary interruption of treatment should be considered if clinically appropriate, until the condition resolves.', 'Synergism', 'Caution is advised if bisphosphonates are used simultaneously or sequentially with denosumab or bevacizumab.', 'Moderate', 'pharmacodynamic', NULL, 'https://ddinter2.scbdd.com/server/interact/83252/', '', 'Cholecalciferol, Vosoritide, Denosumab, Burosumab', 'Tiludronic acid, Vosoritide, Etidronic acid, Cholecalciferol, Burosumab, Zoledronic acid', 1767369485);
INSERT OR IGNORE INTO drug_interactions (id, ingredient1, ingredient2, severity, effect, source, management_text, mechanism_text, recommendation, risk_level, type, metabolism_info, source_url, reference_text, alternatives_a, alternatives_b, updated_at) VALUES (83152, 'Anisindione', 'Deoxycholic acid', 'Moderate', 'Coadministration with agents that alter hemostasis such as anticoagulants, platelet inhibitors, thrombin inhibitors, thrombolytics, or agents that commonly cause thrombocytopenia may increase the risk of submental hematoma or bruising in association with deoxycholic acid administration.', 'DDInter', 'Deoxycholic acid should be used with caution in patients receiving drugs that may interfere with hemostasis.', 'Synergism', '', 'Moderate', 'pharmacodynamic', NULL, 'https://ddinter2.scbdd.com/server/interact/83253/', '', 'Tacrolimus, Minoxidil, Calcium gluconate, Glycopyrronium, Magnesium sulfate, Pimecrolimus, Aminobenzoic acid, Finasteride, Caffeine, Cromoglicic acid, Abrocitinib, More', '', 1767369485);
